function findMaxString (str) {
  const strArr = [...str]
  const storeObj = {}
  let maxNum = 0
  let maxValue = null
  strArr.forEach((item) => {
    storeObj[item] = storeObj[item] === undefined ? 1 : storeObj[item]++
    if (storeObj[item] > maxNum) {
      maxNum = storeObj[item]
      maxValue = item
    }
  })
  return maxValue
}

export {
  findMaxString
}
